// /src/components/CharacterList.tsx
import React, { useState, useEffect } from 'react';
import { fetchCharactersWithMultipleActors } from '../api/charactersApi';

const CharacterList = () => {
  const [charactersData, setCharactersData] = useState<{ [characterName: string]: { movieName: string; actorName: string }[] }>({});

  useEffect(() => {
    const getCharacterData = async () => {
      const data = await fetchCharactersWithMultipleActors();
      setCharactersData(data);
    };
    getCharacterData();
  }, []);

  return (
    <div>
      <h1>Characters with Multiple Actors</h1>
      <ul>
        {Object.keys(charactersData).map((character) => (
          <li key={character}>
            <h2>{character}</h2>
            <ul>
              {charactersData[character].map((entry, idx) => (
                <li key={idx}>
                  {entry.movieName} - {entry.actorName}
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CharacterList;
